import { Component, OnInit } from '@angular/core';
import { DomSanitizer, SafeUrl } from '@angular/platform-browser';
import { AddressService } from '../Services/address.service';

@Component({
  selector: 'app-desk-bar',
  templateUrl: './desk-bar.component.html',
  styleUrls: ['../Styles/Colors.scss',
    './desk-bar.component.scss']
})
export class DeskBarComponent implements OnInit {

  public HomeUrl : SafeUrl[] = [''];
  public ProfileUrl !: SafeUrl;
  public FolderUrl !: SafeUrl;

  public logo = this.address.getLogo()
  public icon = this.address.getIcon();;

  constructor(private address: AddressService,
    private sanitizer: DomSanitizer) {}
    
    
   async ngOnInit() {
      console.log(this.icon);

        await this.HomeUrl.push(this.sanitizer.bypassSecurityTrustResourceUrl(this.icon.home1));
        await this.HomeUrl.push(this.sanitizer.bypassSecurityTrustResourceUrl(this.icon.profile1));
        await this.HomeUrl.push(this.sanitizer.bypassSecurityTrustResourceUrl(this.icon.folder1));
        console.log(this.HomeUrl);
  }

  
}
